package Programs;

public class cat {
	int age;
	String name;
	public cat() {
		age = 0;
		name = "Unknown";
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		cat myObj = new cat();
		System.out.println(myObj.age);
		System.out.println(myObj.name);

	}

}
